As a young person with T1D..
the amount of ignorance &amp; stupidity centered around outside knowledge on diabetes is baffling. The absolute BONKERS mindsets &amp; opinions I've come across over the years for people with t1d are really disheartening. 

So here's some fun facts to learn;

I have two lifestyles;

Collecting/Hoarding/Filling my space with more things I like
&amp;
Simplistic/Minimalism living

Both are complete opposites and one is definitely outshining the other, but whenever I want to make a total 180 I want to rip my hair out.
